import React, { memo } from "react";


function MomoDiv({memoList}){
    var returnMemo;
    var i=0;
    console.log(memoList);
    while(i<memoList.length){
        returnMemo = returnMemo+<div className="memoElement" key={memoList[i]}>{memoList[i]}</div>;
        i=i+1;
    }
    return (
        {returnMemo}
    );
}


export default MomoDiv;
